description:
The Sea of Zipangu: Deep Sea Gold Rush

Science Documentary hosted by Takeshi Shibasaki and Masaru Zenke and Kenta Kuroki, published by NHK in 2013 - English narration


Information
------------------------------

The latest survey found that enormous amounts of minerals resources such as gold and rare metals lie in the seabed surrounding Japan. This program will show how countries and companies are striving to develop and secure offshore resources.

